<html><head><title>Eliminated blocks in HConstfolding</title>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" /><link rel="stylesheet" type="text/css" href="rtwreport.css" /><script language="JavaScript" type="text/javascript">
/*<![CDATA[*/
function rtwTableShrink(obj, id, isSymbol){
  if (isSymbol) {
    hide = "[-]";
    show = "[+]";
  } else {
    hide = "[<u>hide</u>]";
    show = "[<u>show</u>]";
  }
  if (window.document.getElementsByName) {
    var o = window.document.getElementsByName(id);
    for (var oid = 0; oid < o.length; ++oid) {
      if (o[oid].style.display == "none") {
        o[oid].style.display =  "";
      } else {
        o[oid].style.display = "none";
      }
    }
  }
  if (obj.innerHTML.toLowerCase() == show.toLowerCase())
     obj.innerHTML = hide; 
  else 
     obj.innerHTML = show; 
}
/*]]>*/
</script>
